import React, { useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { delCart } from '../redux/action';
import { incrementCounter, decrementCounter, writeCounter } from '../redux/action';

const Confirm = () => {
    const state = useSelector((state) => state.handleCart);
    const stateCounter = useSelector((state) => state.handleCounter);

    let total = 0;

    const cartItems = (cartItem) => {
        const found = stateCounter.find((x) => {
            return x.identification === cartItem.identification
        });

        const precioProducto = cartItem.price * found.count;
        total = total + (cartItem.price * found.count);

        return (
            <div className="px-4 mb-4 bg-light rounded-3">
                <div className="container pt-4">
                    <div className="input-group">
                        <h4 className="mx-auto">{cartItem.title}</h4>
                        <h4 className="mx-auto">Cantidad final: {found.count}</h4>
                        <h4 className="mx-auto">Precio final: $ {precioProducto}</h4>
                    </div>
                </div>
            </div>
        )
    }

    const cartEmtpy = () => {
        return (
            <div className="px-4 bg-light rounded-3 py-5">
                <div className="container py-4">
                    <div className="row justify-content-center">
                        <h3>El carrito esta vacio</h3>
                    </div>
                </div>
            </div>
        )
    }

    const buttonBuy = () => {
        return (
            <div className="container my-5">
                <div className="row justify-content-center">

                    <div className="input-group">
                        <input className="form-control ms-2" type="number" placeholder="Cantidad" />
                        <input className="form-control ms-2" type="number" placeholder="Cantidad" />
                        <input className="form-control ms-2" type="number" placeholder="Cantidad" />
                    </div>

                    <h3 className="display-9 fw-blod">Total compra: $ {total}</h3>
                    <button className="btn btn-outline-dark px-4 py-2 mx-auto">Comprar</button>
                </div>
            </div>
        )
    }

    return (
        <>

            <div>
                <div className="container py-5">
                    <div className="row py-5">

                        <table class="table table-bordered">
                            <thead>
                                <tr>
                                    <th scope="col">Producto</th>
                                    <th scope="col">Cantidad</th>
                                    <th scope="col">Precio final</th>
                                </tr>
                            </thead>
                            <tbody>
                                <tr>
                                    <th scope="row">1</th>
                                    <td>Mark</td>
                                    <td>Otto</td>
                                    <td>@mdo</td>
                                </tr>
                            </tbody>
                        </table>

                        {state.length !== 0 ? state.map(cartItems) : cartEmtpy()}
                        {state.length !== 0 && buttonBuy()}
                    </div>
                </div>
            </div>

        </>
    )

}

export default Confirm;
